import React from 'react';
import { BrowserRouter, Switch , Route } from 'react-router-dom';
import SignIn from './SignIn';

class App extends React.Component{
    render(){
        return(
            <Router>
            <div className="App">
                <Switch>
                    <Route path="/signin" exact Component={SignIn} />
                </Switch>
            </div>
            </Router>
        );
    }
}

export default App;
